import axios from "axios";
import {
  VISUALIZZA_PARCHEGGI,
  ERROR_PARCHEGGI,
  INSERISCI_PARCHEGGIO,
  MODIFICA_PARCHEGGIO,
  GET_SPECIFIC_PARCHEGGIO,
  CANCELLA_PARCHEGGIO,
} from "./type";

// Register User
export const registerParcheggio = (parcheggio, history) => (dispatch) => {
  axios
    .post("/api/parcheggi/addParcheggio", parcheggio)
    .then((res) => window.location.reload())
    .catch((err) =>
      dispatch({
        type: ERROR_PARCHEGGI,
        payload: err.response.data,
      })
    );
};

// Lista Veicoli
export const Listaparcheggi = () => (dispatch) => {
  axios
    .get("/api/parcheggi/parcheggilist")
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: VISUALIZZA_PARCHEGGI,
        payload: res.data,
      });
    })
    .catch((err) => console.error(err));
};

export const ModificaParcheggio = (id, parcheggio) => (dispatch) => {
  axios
    .put(`/api/parcheggi/updateParcheggio/${id}`, parcheggio)
    .then((res) => {
      dispatch({
        type: MODIFICA_PARCHEGGIO,
        payload: res.data,
      });
    })
    .catch((err) => console.error(err));
};

//Delete Customer
export const CancellaParcheggio = (id) => (dispatch) => {
  axios
    .delete(`/api/parcheggi/deleteParcheggio/${id}`)
    .then((res) => {
      console.log(id);
      dispatch({
        type: CANCELLA_PARCHEGGIO,
        payload: id,
      });
    })
    .catch((err) =>
      dispatch({
        type: ERROR_PARCHEGGI,
        payload: err.response.data,
      })
    );
};
export const GetSpecificParcheggio = (id) => (dispatch) => {
  axios
    .get(`/api/parcheggi/parcheggio/${id}`)
    .then((res) => {
      console.log(res.data);
      dispatch({
        type: GET_SPECIFIC_PARCHEGGIO,
        payload: res.data,
      });
    })
    .catch((err) => console.error(err));
};
